<img style="width:300; height:150; float:left;" src="https://image.rakuten.co.jp/ueda/cabinet/designsozai/top_2015/kijihaba.jpg">

<div style="float:left; width:400px; height:150px; margin-top:10px;">
<p>
●カット販売の商品は10cmあたりの価格を表示しております。<br>
※その他、手芸用品は１個あたりの価格を表示しております。
</p>
<p>
<font color="#DF0101">●ご注文は30cm(個数3)から承っております。</font><br>
30cmから、40cm、50cm…と、10cm単位で買い求めいただけます。
</p>

<p>
※30cm以下の数量でご注文いただいた場合、<br><font color="#DF0101">確認等で発送が遅れる場合がございます。</font><br>
ご注文の際お間違いのないようご注意下さいませ。
</p>
</div><div style="clear:left;"></div>


<img alt="生地は余裕をもった数量でご注文下さい" src="https://image.rakuten.co.jp/ueda/cabinet/designsozai/top_2015/2015yoyuu.jpg">

<p>
生地は水通しや地直しをしますと多少縮みますので、余裕をもってご注文下さいませ。<br>
（当店では水通し前の生地をご注文数量でカット致します。）<br>
水通しや地直しを行った後、ご購入個数の長さに満たなくなった場合のご連絡には対応できませんので予めご了承下さいませ。
</p>
<p>
※基本的には生地の目に沿ってカット致しますが、ボーダー柄や等間隔のデザイン柄などで<br>
プリントが歪んでいた場合には柄に沿ってカットしております。
</p>

<img alt="商品の画像は実物とは多少異なります" src="https://image.rakuten.co.jp/ueda/cabinet/designsozai/top_2015/2015gazou.jpg">

<p>
●商品の写真は、実物とは多少異なります。<br>
商品の写真については、お使いのパソコンやブラウザによって色調・光沢感などが異なることがございます。<br>
また、同じ商品でも染め時期、加工時期などにより質が異なることがございます。ご不安な場合はご購入前に一報下さい。
</p>

<img alt="商品の在庫は実店舗と兼ねております" src="https://image.rakuten.co.jp/ueda/cabinet/designsozai/top_2015/2015zaikoha.jpg">

<p>
その為、商品を取り寄せるのに時間がかかる場合や、お客様のご要望にお答えできない場合がございます。<br>
ご了承の上、ご注文下さいませ。
</p>






<img alt="ご注文内容変更について" src="https://image.rakuten.co.jp/ueda/cabinet/designsozai/2016_henkou.jpg">

<p>
ご注文確定後、約30分以内でしたら<font color="#DF0101">「購入履歴」よりお客様ご自身によるご注文内容の修正が可能</font>です。<br>
修正可能箇所は下記の通りです。<br><br>

・ご注文者様、及び送付先情報<br>
・お支払い方法<br>
・配送方法<br>
・ご注文商品の一部削除<br>
・ご注文のキャンセル<br>
・備考欄（自由記入欄）<br><br>

※なお、ご注文個数の変更につきましては、「購入履歴」からの修正ができません。<br>
<font color="#DF0101">ご注文をキャンセルの上、ご希望の個数にて再度ご注文下さいませ。</font><br>
※営業時間外のご注文は、注文変更を30分以上受付けている場合がございます。<br>
</p>







